import React from 'react';
import { Routes } from './src/router';
import { GamesProvider } from './src/context/gameContext';
import { CartContext } from './src/context/gameContext';

export default function App() {
  return (
    <>
    <CartContext>
      <GamesProvider>
        <Routes />
      </GamesProvider>
    </CartContext>
    </>
  );
}
